import React from "react";
import './TodoApp.css';

function TodoApp()
{
    return(
    <>
      <div className="container">
          <div className="row justify-content-around">
              <div className="col-4">
                  <div className="main-div mt-4  ">
                  
                  </div>
              </div>
          </div>
      </div>
    </>
    );
   
}
export default TodoApp;
